<div class="entities" style="line-height: 2.5; direction: ltr">The use of a cyclooxygenase - 2 inhibitor ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06802
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) in an ocular and metastatic animal model of uveal melanoma . The expression of cyclooxygenase - 2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) has been reported as an indicator of poor prognosis in a wide variety of human tumors , including colon , breast and uveal melanoma ( UM ) . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitors have shown promise in controlling the malignancy of several types of tumors . Previous studies have demonstrated the efficacy of a 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

<div class="entities" style="line-height: 2.5; direction: ltr">DB00741 response to stress is associated with myocardial remodeling in salmonid fishes . Cardiac disease is frequently reported in farmed animals , and stress has been implicated as a factor for myocardial dysfunction in commercial fish rearing . DB00741 is a major stress hormone in teleosts , and this hormone has adverse effects on the myocardium . Strains of rainbow trout ( Oncorhynchus mykiss ) selected for divergent post-stress cortisol levels [ high responsive ( HR ) and low responsive ( LR ) ] have been established as a comparative model to examine how fish with contrasting stress-coping styles differ in their physiological and behavioral profiles . We show that the mean cardiosomatic index ( CSI ) of adult HR fish was 34 % higher than in LR fish , mainly because of hypertrophy of the compact myocardium . To characterize the hypertrophy as physiological or pathological , we investigated specific cardiac markers at the transcriptional level . HR hearts had higher mRNA levels of cortisol receptors ( MR , GR1 and GR2 ) , increased P53805 levels [ suggesting enhanced pro-hypertrophic nuclear factor of activated T-cell ( NFAT ) signaling ] and increased 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15692

</mark>
 gene expression ( reflecting increased angiogenesis ) . Elevated collagen ( Col 1a2 ) expression and deposition in HR hearts supported enhanced fibrosis , whereas the heart failure markers 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01160
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and DB04899 were not upregulated in HR hearts . To confirm our results outside the selection model , we investigated the effect of acute confinement stress in wild-type European brown trout , Salmo trutta . A positive correlation between post-stress cortisol levels and CSI was observed , supporting an association between enhanced cortisol response and myocardial remodeling . In conclusion , post-stress cortisol production correlates with myocardial remodeling , and coincides with several indicators of heart pathology , well-known from mammalian cardiology .</div>

 (  ) ) is an atypical antipsychotic that is widely used in the treatment of psychiatric conditions . Unlike other currently available atypical antipsychotics that primarily have varying degrees of dopamine D2 receptor antagonism , aripiprazole is a partial agonist at D2 and serotonin 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 receptors , which may explain differences in tolerability profiles . Recently in the EU , oral aripiprazole 10 mg once daily for 12 weeks was approved for the treatment of moderate to severe manic episodes in adolescents ( aged  13 years ) with bipolar I disorder . Approval was based on a phase 3 , 30 - week US trial in children and adolescents with bipolar I disorder experiencing manic or mixed episodes . Using trial data together with ancillary analyses , the European Medicines Agency concluded that aripiprazole 10 mg once daily for 12 weeks was effective in reducing symptoms of mania , but because of the high drop-out rate , efficacy over 30 weeks of treatment was not proven . Aripiprazole was generally well tolerated in the phase 3 trial . Ancillary analyses indicated that tolerability was less favourable in younger ( 10-12 years ) than in older (  13 years ) subjects , and less favourable with the higher ( 30 mg / day ) than the lower dosage ( 10 mg / day ) . The drug is associated with sedation , weight gain and extrapyramidal symptoms ( EPS ) , although the incidence of EPS over 12 weeks was not significantly different between aripiprazole 10 mg / day and placebo . Data comparing the use of atypical antipsychotics in the treatment of mania in adolescents with bipolar I disorder are limited , but evidence shows that aripiprazole provides a valuable additional therapeutic option for use in this population .</div>

 ( I ( Ks ) ) and to compare with another

 inhibitor , rofecoxib . Currents were recorded in transfected mammalian cells by whole-cell patch-clamp . Celecoxib blocked all the Kv channels analyzed and rofecoxib was always less potent , except on Kv4 . 3 + Q9NS61 channels . Kv1 . 5 block increased in the voltage range of channel activation , decreasing at potentials positive to 0 mV . The drug modified the activation curve of the channels that became biphasic . Block was frequency-dependent , increasing at fastest frequencies . Celecoxib effects were not altered by DB08837 ( out ) in R487Y mutant Kv1 . 5 channels but the kinetics of block were slower and the degree of block was smaller with DB08837 ( in ) , indicating that celecoxib acts from the cytosolic side . We confirmed the blocking properties of celecoxib on native Kv currents from rat vascular cells , where Kv1 . 5 are the main contributors ( IC ( 50 )  7 M ) . Finally , we demonstrate that celecoxib prolongs the action potential duration in mouse cardiac myocytes and shortens it in guinea pig cardiac myocytes , suggesting that Kv block induced by celecoxib may be of clinical relevance .</div>
